let weaponProperties = `[{"id":1,"name":"Ammunition","description":"You can use a weapon that has the ammunition property to make a ranged attack only if you have ammunition to fire from the weapon. Each time you attack with the weapon, you expend one piece of ammunition. Drawing the ammunition from a quiver, case, or other container is part of the attack (you need a free hand to load a one-handed weapon).","url":"http://www.dnd5eapi.co/api/weapon-properties/1"},{"id":2,"name":"Finesse","description":"When making an attack with a finesse weapon, you use your choice of your Strength or Dexterity modifier for the attack and damage rolls. You must use the same modifier for both rolls.","url":"http://www.dnd5eapi.co/api/weapon-properties/2"},{"id":3,"name":"Heavy","description":"Small creatures have disadvantage on attack rolls with heavy weapons. A heavy weapon’s size and bulk make it too large for a Small creature to use effectively.","url":"http://www.dnd5eapi.co/api/weapon-properties/3"},{"id":4,"name":"Light","description":"A light weapon is small and easy to handle, making it ideal for use when fighting with two weapons.","url":"http://www.dnd5eapi.co/api/weapon-properties/4"},{"id":5,"name":"Loading","description":"Because of the time required to load this weapon, you can fire only one piece of ammunition from it when you use an action, bonus action, or reaction to fire it, regardless of the number of attacks you can normally make.","url":"http://www.dnd5eapi.co/api/weapon-properties/5"},{"id":6,"name":"Reach","description":"This weapon adds 5 feet to your reach when you attack with it, as well as when determining your reach for opportunity attacks with it.","url":"http://www.dnd5eapi.co/api/weapon-properties/6"},{"id":7,"name":"Special","description":"A weapon with the special property has unusual rules governing its use, explained in the weapon’s description (see “Special Weapons” later in this section).","url":"http://www.dnd5eapi.co/api/weapon-properties/7"},{"id":8,"name":"Thrown","description":"If a weapon has the thrown property, you can throw the weapon to make a ranged attack. If the weapon is a melee weapon, you use the same ability modifier for that attack roll and damage roll that you would use for a melee attack with the weapon. For example, if you throw a handaxe, you use your Strength, but if you throw a dagger, you can use either your Strength or your Dexterity, since the dagger has the finesse property.","url":"http://www.dnd5eapi.co/api/weapon-properties/8"},{"id":9,"name":"Two-Handed","description":"This weapon requires two hands when you attack with it.","url":"http://www.dnd5eapi.co/api/weapon-properties/9"},{"id":10,"name":"Versatile","description":"This weapon can be used with one or two hands. A damage value in parentheses appears with the property—the damage when the weapon is used with two hands to make a melee attack.","url":"http://www.dnd5eapi.co/api/weapon-properties/10"},{"id":11,"name":"Monk","description":"Monks gain several benefits while unarmed or weilding only monk weapons while they aren't wearing armor or wielding shields.","url":"http://www.dnd5eapi.co/api/weapon-properties/11"}]`;

