let damageTypes = `[{"id":1,"name":"Acid","description":"The corrosive spray of a black dragon’s breath and the dissolving enzymes secreted by a black pudding deal acid damage.","url":"http://www.dnd5eapi.co/api/damage-types/1"},{"id":2,"name":"Bludgeoning","description":"Blunt force attacks, falling, constriction, and the like deal bludgeoning damage.","url":"http://www.dnd5eapi.co/api/damage-types/2"},{"id":3,"name":"Cold","description":"The infernal chill radiating from an ice devil’s spear and the frigid blast of a white dragon’s breath deal cold damage.","url":"http://www.dnd5eapi.co/api/damage-types/3"},{"id":4,"name":"Fire","description":"Red dragons breathe fire, and many spells conjure flames to deal fire damage.","url":"http://www.dnd5eapi.co/api/damage-types/4"},{"id":5,"name":"Force","description":"Force is pure magical energy focused into a damaging form. Most effects that deal force damage are spells, including magic missile and spiritual weapon.","url":"http://www.dnd5eapi.co/api/damage-types/5"},{"id":6,"name":"Lightning","description":"A lightning bolt spell and a blue dragon’s breath deal lightning damage.","url":"http://www.dnd5eapi.co/api/damage-types/6"},{"id":7,"name":"Necrotic","description":"Necrotic damage, dealt by certain undead and a spell such as chill touch, withers matter and even the soul.","url":"http://www.dnd5eapi.co/api/damage-types/7"},{"id":8,"name":"Piercing","description":"Puncturing and impaling attacks, including spears and monsters’ bites, deal piercing damage.","url":"http://www.dnd5eapi.co/api/damage-types/8"},{"id":9,"name":"Poison","description":"Venomous stings and the toxic gas of a green dragon’s breath deal poison damage.","url":"http://www.dnd5eapi.co/api/damage-types/9"},{"id":10,"name":"Psychic","description":"Mental abilities such as a psionic blast deal psychic damage.","url":"http://www.dnd5eapi.co/api/damage-types/10"},{"id":11,"name":"Radiant","description":"Radiant damage, dealt by a cleric’s flame strike spell or an angel’s smiting weapon, sears the flesh like fire and overloads the spirit with power.","url":"http://www.dnd5eapi.co/api/damage-types/11"},{"id":12,"name":"Slashing","description":"Swords, axes, and monsters’ claws deal slashing damage.","url":"http://www.dnd5eapi.co/api/damage-types/12"},{"id":13,"name":"Thunder","description":"A concussive burst of sound, such as the effect of the thunderwave spell, deals thunder damage.","url":"http://www.dnd5eapi.co/api/damage-types/13"}]`;

let skills = `[{"id":1,"name":"Acrobatics","description":"Your Dexterity (Acrobatics) check covers your attempt to stay on your feet in a tricky situation, such as when you’re trying to run across a sheet of ice, balance on a tightrope, or stay upright on a rocking ship’s deck. The GM might also call for a Dexterity (Acrobatics) check to see if you can perform acrobatic stunts, including dives, rolls, somersaults, and flips.","ability_id":1,"url":"http://www.dnd5eapi.co/api/skills/1"},{"id":2,"name":"Animal Handling","description":"When there is any question whether you can calm down a domesticated animal, keep a mount from getting spooked, or intuit an animal’s intentions, the GM might call for a Wisdom (Animal Handling) check. You also make a Wisdom (Animal Handling) check to control your mount when you attempt a risky maneuver.","ability_id":5,"url":"http://www.dnd5eapi.co/api/skills/2"},{"id":3,"name":"Arcana","description":"Your Intelligence (Arcana) check measures your ability to recall lore about spells, magic items, eldritch symbols, magical traditions, the planes of existence, and the inhabitants of those planes.","ability_id":4,"url":"http://www.dnd5eapi.co/api/skills/3"},{"id":4,"name":"Athletics","description":"Your Strength (Athletics) check covers difficult situations you encounter while climbing, jumping, or swimming.","ability_id":1,"url":"http://www.dnd5eapi.co/api/skills/4"},{"id":5,"name":"Deception","description":"Your Charisma (Deception) check determines whether you can convincingly hide the truth, either verbally or through your actions. This deception can encompass everything from misleading others through ambiguity to telling outright lies. Typical situations include trying to fast- talk a guard, con a merchant, earn money through gambling, pass yourself off in a disguise, dull someone’s suspicions with false assurances, or maintain a straight face while telling a blatant lie.","ability_id":6,"url":"http://www.dnd5eapi.co/api/skills/5"},{"id":6,"name":"History","description":"Your Intelligence (History) check measures your ability to recall lore about historical events, legendary people, ancient kingdoms, past disputes, recent wars, and lost civilizations.","ability_id":4,"url":"http://www.dnd5eapi.co/api/skills/6"},{"id":7,"name":"Insight","description":"Your Wisdom (Insight) check decides whether you can determine the true intentions of a creature, such as when searching out a lie or predicting someone’s next move. Doing so involves gleaning clues from body language, speech habits, and changes in mannerisms.","ability_id":5,"url":"http://www.dnd5eapi.co/api/skills/7"},{"id":8,"name":"Intimidation","description":"When you attempt to influence someone through overt threats, hostile actions, and physical violence, the GM might ask you to make a Charisma (Intimidation) check. Examples include trying to pry information out of a prisoner, convincing street thugs to back down from a confrontation, or using the edge of a broken bottle to convince a sneering vizier to reconsider a decision.","ability_id":6,"url":"http://www.dnd5eapi.co/api/skills/8"},{"id":9,"name":"Investigation","description":"When you look around for clues and make deductions based on those clues, you make an Intelligence (Investigation) check. You might deduce the location of a hidden object, discern from the appearance of a wound what kind of weapon dealt it, or determine the weakest point in a tunnel that could cause it to collapse. Poring through ancient scrolls in search of a hidden fragment of knowledge might also call for an Intelligence (Investigation) check.","ability_id":4,"url":"http://www.dnd5eapi.co/api/skills/9"},{"id":10,"name":"Medicine","description":"A Wisdom (Medicine) check lets you try to stabilize a dying companion or diagnose an illness.","ability_id":5,"url":"http://www.dnd5eapi.co/api/skills/10"},{"id":11,"name":"Nature","description":"Your Intelligence (Nature) check measures your ability to recall lore about terrain, plants and animals, the weather, and natural cycles.","ability_id":4,"url":"http://www.dnd5eapi.co/api/skills/11"},{"id":12,"name":"Perception","description":"Your Wisdom (Perception) check lets you spot, hear, or otherwise detect the presence of something. It measures your general awareness of your surroundings and the keenness of your senses. For example, you might try to hear a conversation through a closed door, eavesdrop under an open window, or hear monsters moving stealthily in the forest. Or you might try to spot things that are obscured or easy to miss, whether they are orcs lying in ambush on a road, thugs hiding in the shadows of an alley, or candlelight under a closed secret door.","ability_id":5,"url":"http://www.dnd5eapi.co/api/skills/12"},{"id":13,"name":"Performance","description":"Your Charisma (Performance) check determines how well you can delight an audience with music, dance, acting, storytelling, or some other form of entertainment.","ability_id":6,"url":"http://www.dnd5eapi.co/api/skills/13"},{"id":14,"name":"Persuasion","description":"When you attempt to influence someone or a group of people with tact, social graces, or good nature, the GM might ask you to make a Charisma (Persuasion) check. Typically, you use persuasion when acting in good faith, to foster friendships, make cordial requests, or exhibit proper etiquette. Examples of persuading others include convincing a chamberlain to let your party see the king, negotiating peace between warring tribes, or inspiring a crowd of townsfolk.","ability_id":6,"url":"http://www.dnd5eapi.co/api/skills/14"},{"id":15,"name":"Religion","description":"Your Intelligence (Religion) check measures your ability to recall lore about deities, rites and prayers, religious hierarchies, holy symbols, and the practices of secret cults.","ability_id":4,"url":"http://www.dnd5eapi.co/api/skills/15"},{"id":16,"name":"Sleight of Hand","description":"Whenever you attempt an act of legerdemain or manual trickery, such as planting something on someone else or concealing an object on your person, make a Dexterity (Sleight of Hand) check. The GM might also call for a Dexterity (Sleight of Hand) check to determine whether you can lift a coin purse off another person or slip something out of another person’s pocket.","ability_id":2,"url":"http://www.dnd5eapi.co/api/skills/16"},{"id":17,"name":"Stealth","description":"Make a Dexterity (Stealth) check when you attempt to conceal yourself from enemies, slink past guards, slip away without being noticed, or sneak up on someone without being seen or heard.","ability_id":2,"url":"http://www.dnd5eapi.co/api/skills/17"},{"id":18,"name":"Survival","description":"The GM might ask you to make a Wisdom (Survival) check to follow tracks, hunt wild game, guide your group through frozen wastelands, identify signs that owlbears live nearby, predict the weather, or avoid quicksand and other natural hazards.","ability_id":5,"url":"http://www.dnd5eapi.co/api/skills/18"}]`;

